function changeSelectedQr(valueSelected) {


    if (valueSelected == '3') {

        shapes = s.selectAll('.hf');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '1', 'fill-opacity': '1' }, 1000);
        });


        shapes = s.selectAll('.hgl');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'fill-opacity': '1' }, 1000)
            ;


        });

    }
    else {

        shapes = s.selectAll('.hf');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '0', 'fill-opacity': '0' }, 1000);
        });
    }

    if (valueSelected == '2') {
        shapes = s.selectAll('.wrs');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '1', 'fill-opacity': '1' }, 1000);
        });

        shapes = s.selectAll('.hgl');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'fill-opacity': '1' }, 1000)
            ;


        });


    }
    else {
        shapes = s.selectAll('.wrs');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '0', 'fill-opacity': '0' }, 1000);
        });
    }



    if (valueSelected == '1') {
        shapes = s.selectAll('.ts');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '0.03', 'fill-opacity': '0.03' }, 1000);
        });



        s.selectAll('.hgl').forEach(function (elem, i) {
            elem.stop().animate({ 'fill-opacity': '0' }, 100)
            ;
        });

        shapes = s.selectAll('.wrs');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '1', 'fill-opacity': '1' }, 1000);
        });


    }
    else {

        shapes = s.selectAll('.ts');
        shapes.forEach(function (elem, i) {
            elem.stop().animate({ 'opacity': '1', 'fill-opacity': '1' }, 1000);
        });
    }
    currentq = parseInt(valueSelected);


}

var ispan = false;

function pageloaded() {

    //add drag handler
    moveFnc = function (dx, dy, x, y) {
        if (ispan) {
            var thisBox = this.getBBox();
            console.log(thisBox.x, thisBox.y, thisBox);
            lx = dx + ox;
            ly = dy + oy;
            this.transform('t' + lx + ',' + ly);
        }
    }
    startFnc = function (x, y, e) { }
    endFnc = function () {
        if (ispan) {
            ox = lx;
            oy = ly;
            console.log(this.getBBox());
        }
    };

    var tgroup = s.select(".pageviewer");
    //rct = s.rect(0, 0, 245, 375);
    //rct.attr({ 'fill-opacity': "0.5" })
    //tgroup.add(rct);

    tgroup.drag(moveFnc, startFnc, endFnc);

    s.select('.page').stop().animate({ transform: 's' + 2.2 + ',0,0' }, 000);
    //rct.stop().animate({ transform: 's' + 1.1 + ',0,0' }, 000);

    //    tg.remove(rct);

    $('#qtype').change(function () {
        var optionSelected = $('#qtype').find("option:selected");
        var valueSelected = optionSelected.val();
        var textSelected = optionSelected.text();


        changeSelectedQr(valueSelected);


    });

    changeSelectedQr('1');

    $("#bootstrap-slider").slider();
    $("#bootstrap-slider").on("slide", function (slideEvt) {
        $("#sliderValue").text(slideEvt.value);
        newvalue = slideEvt.value;
        var x = parseInt(newvalue);
        var y = 1 + (x + 1) * 0.6;
        var pent = s.select('.page');
        pent.stop().animate({ transform: 's' + y + ',50,100' }, 1000);
        //   rct.stop().animate({ transform: 's' + y + ',0,0' }, 000);

    });

    $('.slider').on("slideStop", function () {
        var newvalue = $('.tooltip-inner').text();
        $("#sliderValue").text(newvalue);

        var x = parseInt(newvalue);
        var y = 1 + (x + 1) * 0.6;
        var pent = s.select('.page');
        pent.stop().animate({ transform: 's' + y + ',50,100' }, 1000);
        // rct.stop().animate({ transform: 's' + y+ ',0,0' }, 000);


    });


    //word highlight

    var highligtShapes = s.selectAll('.hg');
    //elem.selectAll('g').attr({fill: "#5385c"});
    // and for each one we add the desired interactivity
    highligtShapes.forEach(function (elem, i) {
        // change the color on mouse over

        elem.stop().animate({ 'fill-opacity': '0.0' }, 000);

        elem.mousedown(function () {
            if (!ispan) {


                console.log("down " + this.attr('id'));
                wordselection.startword = parseInt(this.attr('id').replace("h_w_", ""));
            }
        });


        elem.mouseup(function () {
            if (!ispan) {

                console.log("up " + this.attr('id'));
                wordselection = {};
            }
        });



        elem.mouseout(function () {
            //  console.log("up " + this.attr('id'));
            //    wordselection = {};
        });
        elem.mousemove(function () {
            if (!ispan) {

                //  console.log("move " + this.attr('id'));
                if (wordselection.startword) {
                    wordselection.endword = parseInt(this.attr('id').replace("h_w_", ""));
                    if (wordselection.endword < wordselection.startword) {
                        //    var tmp = wordselection.startword;
                        //  wordselection.startword = wordselection.endword;
                        //wordselection.endword = tmp;


                        //   for (var i = (wordselection.startword) ; i >= (wordselection.endword) ; i--) {
                        //     s.select("#h_w_" + i).attr('fill-opacity', '0.3');
                        // }


                        highligtShapes.forEach(function (elem, i) {
                            var num = parseInt(elem.attr('id').replace("h_w_", ""));
                            if (num < wordselection.endword || num > wordselection.startword)
                                elem.attr('fill-opacity', '0')
                            else
                                elem.attr('fill-opacity', '0.3');

                        });

                    }
                    else {
                        //   for (var i = (wordselection.startword) ; i <= (wordselection.endword) ; i++) {
                        //     s.select("#h_w_" + i).attr('fill-opacity', '0.3' );

                        //}

                        // shapes = s.selectAll('.hg');
                        //elem.selectAll('g').attr({fill: "#5385c"});
                        // and for each one we add the desired interactivity
                        highligtShapes.forEach(function (elem, i) {
                            var num = parseInt(elem.attr('id').replace("h_w_", ""));
                            if (num > wordselection.endword || num < wordselection.startword)
                                elem.attr('fill-opacity', '0');
                            else
                                elem.attr('fill-opacity', '0.3');

                        });

                    }

                }
            }
        });
        // restore the color on mouse out
        elem.mouseout(function () {
            //this.attr({fill: "#ffffff"});
        });
    });



}
